import { ReserveIsLimitService } from './reserve-is-limit.service'
export default {
  name: 'ReserveIsLimitFormItem',
  serviceInject() {
    return {
      reserveIsLimitService: ReserveIsLimitService
    }
  },
  rxState() {
    const { reserveLimitDay$, reserveIsLimit$ } = this.reserveIsLimitService
    return {
      reserveLimitDay$,
      reserveIsLimit$
    }
  },
  data() {
    return {
      reserveIsLimit: 0
    }
  },
  props: {
    decorators: {
      type: Object,
      default: () => {}
    },
    labelWidth: {
      type: String,
      default: ''
    },
    reserveIsLimitInfo: {
      type: Object,
      default: () => {
        return {
          reserve_is_limit: 0,
          reserve_limit_day: 1,
          reserve_limit_times: 3
        }
      }
    }
  },
  computed: {
    validateObject() {
      let isEmptyObject = Object.keys(this.decorators).length
      if (!isEmptyObject) {
        return {
          reserve_is_limit: [
            'reserve_is_limit',
            {
              initialValue: this.reserveIsLimitInfo.reserve_is_limit
            }
          ],
          reserve_limit_day: [
            'reserve_limit_day',
            {
              initialValue: this.reserveIsLimitInfo.reserve_limit_day
            }
          ],
          reserve_limit_times: [
            'reserve_limit_times',
            {
              initialValue: this.reserveIsLimitInfo.reserve_limit_times
            }
          ]
        }
      }
      return this.decorators
    }
  },
  methods: {
    onChangeReserveIslimit(event) {
      this.reserveIsLimit = event.target.value
    }
  },
  created() {
    this.reserveIsLimit = this.validateObject.reserve_is_limit[1].initialValue
  }
}
